window.bookSummaryJSON = "<p><b>I'm the silent ache, the shadow that lingers, the present from your past, the knife in your heart.</b></p> <p>In the chilling finale of the Frozen Fate trilogy, Frankie enters a world far deadlier than the one she escaped.</p> <p>A sinister threat lurks in the shadows, hunting her with a dark obsession as her savage protectors battle the rules of society.</p> <p>Thrust into the civilized world, they spiral into violence and refuse to conform, their wild natures threatening to tear apart their bond.</p> <p>Amid these struggles, her seductive billionaire husband fights to reclaim her love.</p> <p>Caught between possessive men, a deadly stalker, and a legacy of pain, she must decide her fate.</p> <p>Choose wrongly, and she'll lose everything to a monster with a heart of frost and scars.</p> <p><i>Narrated in duet style.</i></p>"; 
